import React from 'react'
import styled from 'styled-components'

const SideBar = styled.div`
  position: absolute;  
  width: 17em;
  height: 100%;
  top: 0;
  overflow:hidden;
  background-color: #19222a;
  -webkit-transform: translateZ(0);
  visibility: visible;
  -webkit-backface-visibility: hidden;
`
const Link = styled.a`
    color:#ffffff ;
    size:12px ;
`

const LinksSection = styled.ul`
    list-style:none;
    display: block;
    padding: 0;
    margin: 0;
`

const ListOfLinks = styled

function AdminPanel() {
    return (
        <SideBar>
            <LinksSection>
                <Link>FOODS</Link>
                <Link>ORDERS</Link>
                <Link>UPLOAD FORM</Link>
            </LinksSection>
        </SideBar>
    )
}

export default AdminPanel
